    return fmt.Sprintf("Port %d: Open", port)
}

func main() {
    hostname := "localhost"
    timeout := time.Second
    openPorts := []int{}

    for port := 1; port <= 1024; port++ {
        result := scanPort(hostname, port, timeout)
        fmt.Println(result)

        if result == fmt.Sprintf("Port %d: Open", port) {
            openPorts = append(openPorts, port)
        }
    }

    fmt.Printf("Open ports: %v\n", openPorts)
}
```

